import React from 'react'
import Login from './components/LogIn'
const App = (props) => {
  const { notes } = props
  notes.map(note => <li>{note.content}</li>)
  return(Login)
  return (
    <div>
     {notes.map(note => 
          <li key={note.id}>{note.content}</li>)}
    </div>
  )
}

export default App
